INSERT INTO `catalogue_pages` VALUES (1,-1,1,1,1,0,'Frontpage',1,6,'frontpage3','[\"catalog_frontpage_headline2_en\",\"{input1}\"]','[\"{input2}\",\"{input3}\",\"{input4}\",\"How do I get Credits easily?\",\"1. Always ask permission from the bill payer first.\\r\\n2. Send HABBO in a UK SMS to 78881. You\'\'ll get an SMS back with a voucher code and will be charged 3 plus your standard UK SMS rate, normally 10p.\\r\\n3. Enter the code below to redeem 35 Credits. For Habbo Credit options or to redeem a Wallie Voucher Card, simply click \\\"Get Credits >>\\\" below.\",\"Redeem a Habbo Voucher code here:\",\"\",\"#FAF8CC\",\"#FAF8CC\",\"scifi\"]',NULL,0),(2,-1,3,1,0,0,'Furni Shop',2,3,'','[]','[]',NULL,0),(3,2,1,1,1,0,'Spaces',55,0,'spaces','[\"catalog_spaces_headline1\"]','[\"Floors, wallpapers, landscapes - get a groovy combination to your room. Use our virtual room preview below to test out the combinations before you buy. Select the design and color you like and click Buy.\"]',NULL,0),(4,-1,7,1,1,0,'Habbo Exchange',6,11,'default_3x3','[\"catalog_bank_headline1\",\"catalog_bank_teaser\",\"catalog_special_txtbg1\"]','[\"The Habbo Exchange is where you can convert your Habbo Credits into a tradable currency. You can use this tradable currency to exchange Habbo Credits for Furni!\",\"Click on the item you want for more information\",\"Refundable       Goods!\"]',NULL,0),(5,2,5,1,1,0,'Rollers',96,0,'default_3x3','[\"catalog_roller_headline1\",\"catalog_teaser_rollers_en\",\"catalog_special_txtbg1\"]','[\"Move your imagination, while you move your Habbo!  Perfect for mazes, games, for keeping your queue moving or making your pet go round in circles for hours.  Available in multi-packs - the more you buy the cheaper the Roller! Pink Rollers out now!\",\"Click on a Roller to see more information!\",\"You can fit 30 Rollers in a user flat!\"]',NULL,0),(6,2,5,1,1,0,'Teleporters',58,0,'default_3x3','[\"catalog_doors_headline1\",\"catalog_teleports_teaser2_en\",\"catalog_special_txtbg1\"]','[\"Beam your user from one room to another with one of our cunningly disguised, space age teleports. Now you can link any two rooms together! Teleports are sold in pairs, so if you trade for them, check you\'re getting a linked pair.\",\"Click on the item you want for more information\",\"New Door Teleport!\"]',NULL,0),(7,54,10,1,1,0,'Pets',8,0,'pets','[\"catalog_pet_headline1\"]','[\"Fluff and whiskers, meows and woofs! You\'\'re about to enter the world of small creatures with furry features. Find a new friend from our ever-changing selection. From faithful servants to playful playmates - here\'s where you\'\'ll find them all.\",\"Find your own pet!\"]',NULL,0),(8,54,10,1,1,0,'Pet Accessories',43,0,'default_3x3','[\"catalog_pet_headline2\",\"ctlg_pet_teaser1\",\"catalog_special_txtbg2\"]','[\"You\'\'ll need to take care of your pet to keep it happy and healthy. This section of the Catalogue has EVERYTHING you\'ll need to satisfy your pet\'s needs.\",\"Click on the item you want for more information\",\"You\'ll have to share it!\"]',NULL,0),(9,2,6,1,1,0,'Area',14,0,'default_3x3','[\"catalog_area_headline1\",\"catalog_area_teaser1\",\"catalog_special_txtbg2\"]','[\"Introducing the Area Collection...  Clean, chunky lines set this collection apart as a preserve of the down-to-earth person. It\'s beautiful in its simplicity, and welcoming to everyone.\",\"Click on the item you want for more information\",\"Beautiful in it\'s simplicity!\"]',NULL,0),(10,2,7,1,1,0,'Gothic',30,0,'default_3x3','[\"catalog_gothic_headline1\",\"catalog_gothic_teaser1\"]','[\"The Gothic section is full of medieval looking items. Create your own Gothic castle!\",\"Click on the item you want for more information\",\"\"]',NULL,0),(11,-1,5,1,0,0,'Trax',4,4,'default_3x3','[]','[]',NULL,0),(12,2,8,1,1,0,'Candy',19,0,'default_3x3','[\"catalog_candy_headline1\",\"catalog_candy_teaser1\",\"catalog_special_txtbg2\"]','[\"Candy combines the cool, clean lines of the Mode collection with a softer, more soothing style. It\'\'s urban sharpness with a hint of the feminine.\",\"Click on the item you want for more information\",\"Relax! It\'s faux-fur.\"]',NULL,0),(13,2,9,1,1,0,'Asian',15,0,'default_3x3','[\"catalog_asian_headline1\",\"catalog_asian_teaser1\"]','[\"Introducing the Asian collection... These handcrafted items are the result of years of child slavery, some mixture of Ying and Yang and a mass-shipping from China. These authentic items fit in every oriental themed user flat.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(14,2,10,1,1,0,'Iced',72,0,'default_3x3','[\"catalog_iced_headline1\",\"catalog_iced_teaser1\",\"catalog_special_txtbg2\"]','[\"Introducing the Iced Collection...  For the person who needs no introduction. It\'s so chic, it says everything and nothing. It\'s a blank canvas, let your imagination to run wild!\",\"Click on the item you want for more information\",\" These chairs are so comfy.\"]',NULL,0),(15,2,11,1,1,0,'Lodge',37,0,'default_3x3','[\"catalog_lodge_headline1\",\"catalog_lodge_teaser1\",\"catalog_special_txtbg2\"]','[\"Introducing the Lodge Collection...  Do you appreciate the beauty of wood?  For that ski lodge effect, or to match that open fire... Lodge is the Furni of choice for people with that no frills approach to decorating.\",\"Click on the item you want for more information\",\" I LOVE this wood Furni!\"]',NULL,0),(16,2,12,1,1,0,'Plasto',46,0,'plasto','[\"catalog_plasto_headline1\",\"\"]','[\"Introducing The Plasto Collection...  Can you feel that 1970s vibe?  Decorate with Plasto and add some colour to your life. Choose a colour that reflect your mood, or just pick your favourite shade.\",\"Select an item and a colour and buy!\"]',NULL,0),(17,2,13,1,1,0,'Pura',48,0,'default_3x3','[\"catalog_pura_headline1\",\"catalog_pura_teaser1\"]','[\"Introducing the Pura Collection...  This collection breathes fresh, clean air and cool tranquillity. Use it to create a special haven away from the hullabaloo of life outside the Hotel.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(18,2,14,1,1,0,'Mode',39,0,'default_3x3','[\"catalog_mode_headline1\",\"catalog_mode_teaser1\",\"catalog_special_txtbg2\"]','[\"Introducing the Mode Collection...  Steely grey functionality combined with sleek designer upholstery. The person that chooses this furniture is a cool urban cat - streetwise, sassy and so slightly untouchable.\",\"Click on the item you want for more information\",\"So shiny and new...\"]',NULL,0),(19,2,15,1,1,0,'Accessories',11,0,'default_3x3','[\"catalog_extra_headline1\",\"catalog_extra_teaser1\",\"catalog_special_txtbg2\"]','[\"Is your room missing something?  Well, now you can add the finishing touches that express your true personality. And don\'t forget, like everything else, these accessories can be moved about to suit your mood.\",\"Click on the item you want for more information\",\"I love my rabbit...\"]',NULL,0),(20,2,16,1,1,0,'Bathroom',17,0,'default_3x3','[\"catalog_bath_headline1\",\"catalog_bath_teaser1\",\"catalog_special_txtbg2\"]','[\"Introducing the Bathroom Collection...  Have some fun with the cheerful bathroom collection. Give yourself and your guests somewhere to freshen up - vital if you want to avoid nasty niffs. Put your loo in a corner though...\",\"Click on the item you want for more information\",\"  Every Habbo needs one!\"]',NULL,0),(21,2,18,1,1,0,'Plants',45,0,'default_3x3','[\"catalog_plants_headline1\",\"catalog_plants_teaser1\"]','[\"Introducing the Plant Collection...  Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! Do we give a fuck? Up to you!\",\"Click on the item you want for more information\",\"\"]',NULL,0),(22,2,17,1,1,0,'Sports',56,0,'default_3x3','[\"catalog_sports_headline1\",\"catalog_sports_teaser1\"]','[\"For the sporty people, here is the Sports section! Create your own hockey stadium!\",\"Click on the item you want for more information\",\"\"]',NULL,0),(23,2,19,1,1,0,'Rugs',52,0,'default_3x3','[\"catalog_rugs_headline1\",\"catalog_rugs_teaser1\",\"catalog_special_txtbg2\"]','[\"We have rugs for all occasions. All rugs are non-slip and washable.\",\"Click on the item you want for more information\",\"We have rugs for ANY room!\"]',NULL,0),(24,2,20,1,1,0,'Gallery',47,0,'default_3x3','[\"catalog_gallery_headline1\",\"catalog_posters_teaser1\",\"catalog_special_txtbg2\"]','[\"Adorn your walls with wondrous works of art, posters, plaques and wall hangings. We have items to suit all tastes, from kitsch to cool, traditional to modern.\",\"Click on the item you want for more information\",\"Brighten up your walls!\"]',NULL,0),(25,2,21,1,1,0,'Flags',47,0,'default_3x3','[\"catalog_flags_headline1\",\"catalog_flags_teaser1\",\"catalog_special_txtbg2\"]','[\"If you\'re feeling patriotic, get a flag to prove it. Our finest cloth flags will brighten up the dullest walls.\",\"Click on the item you want for more information\",\"Flag this section for later!\"]',NULL,0),(26,2,22,1,1,0,'Trophies',60,0,'trophies','[\"catalog_trophies_headline1\",\"\"]','[\"Reward your friends, or yourself with one of our fabulous glittering array of bronze, silver and gold trophies.\r\nFirst choose the trophy model (click on the arrows to see all the different styles) and then the metal (click on the seal below the trop\",\"\"]',NULL,0),(27,63,3,6,1,0,'Club Gifts',3009,0,'default_3x3','[\"catalog_club_headline1\",\"catalog_hc_teaser\"]','[\"Welcome to the Club Shop! All \'Habbo Club membership gifts\' are available here, use them wisely you greedy cunt! We have sofas, butlers and all the happy stuff.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(28,62,1,6,1,0,'Dragons',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"The Dragon page contains all of the Dragon Lamps.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(29,62,1,6,1,0,'Sci-fi Doors',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(30,62,1,6,1,0,'Parasols',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(31,62,1,6,1,0,'Screens',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(32,62,1,6,1,0,'Marquees',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(33,62,1,6,1,0,'Pillows',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(34,62,1,6,1,0,'Icecream',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(35,62,1,6,1,0,'Smoke machines',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(36,62,1,6,1,0,'Sci-Fi Ports',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(37,62,1,6,1,0,'Amber Lamp',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(38,62,1,6,1,0,'Fountains',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(39,62,1,6,1,0,'Elephants',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(40,62,1,6,1,0,'Fans',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(41,2,4,1,1,0,'Camera',33,0,'camera1','[\"catalog_camera_headline1\",\"campic_cam\",\"\",\"campic_film\"]','[\"With your Camera you can take pictures of just about anything in the hotel - your friend on the loo (hehe), your best dive in the Lido, or your room when you\'ve got it just right!\\r\\nA camera costs 10 Credits (two free photos included).\",\"When you\'ve used your free photos, you\'ll need to buy more. Each roll of film takes five photos. Your Camera will show how much film you have left and loads the next roll automatically.\\r\\nEach Film (5 photos) costs:      6 Credits\"]',NULL,0),(42,1000,1,1,1,0,'Camera How-To',0,0,'camera2','[\"catalog_camera_headline1\",\"campic_help\"]','[\"CAMERA FUNCTIONS\\r\\n1. Press this button to take a photo.                      2. Photo cancel - for when you\'ve chopped off your friend\'s head!                                     3. Zoom in and out.                                     4. Photo counter - shows how much film you have left                                                        5. Caption Box - write your caption before saving the photo.                                              6. Save - this moves the photo to your giant.\\r\\nYou can give photos to your friends, or put them on the wall like posters.\",\"\"]',NULL,0),(43,62,1,6,1,0,'Inflatable Chairs',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(44,62,1,6,1,0,'Rares Mixed',3009,0,'default_3x3','[\"catalog_rares_headline1\",\"\"]','[\"Yet another rares page.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(45,2,23,1,1,0,'Executive',27,0,'default_3x3','[\"catalog_exe_headline1_en\",\"catalog_exe_teaser_en\"]','[\"The Executive Furni is ideal for creating a sophisticated working environment, whether it be an office, a mafia headquarters or study!\",\"Click on the item you want for more information\",\"\"]',NULL,0),(46,2,24,1,1,0,'Alhambra',12,0,'soundmachine','[\"catalog_alh_headline2\",\"catalog_alh_teaser2\",\"catalog_special_txtbg1\"]','[\"The Palace of Alhambra has appeared and with it this exotic and beautifully crafted range of Arabian Furni. Luxury seating and gourmet food combine to make your room sparkle with riches.\",\"Click on the item you want for more information\",\"Get your Alhambrian goodies now!\"]',NULL,0),(50,1000,2,10,1,0,'Easter LTD',10,7,'cars','[\"catalog_easter_headline1\",\"catalog_easter_teaser1\",\"\"]','[\"Offering for a limited time, the 2022 Easter Egg, this will not be sold ever again. You may either buy it for yourself, trade it or gift it to others.\",\"\",\"\"]',NULL,0),(51,-1,2,1,1,0,'Collectables',3,2,'default_3x3','[\"catalog_cltbs_header1_uk\",\"catalog_cltbs_teaser_en\"]','[\"Collect your way to the riches! Collectables are special furniture sold only for a limited period of time. They cost a wee bit more, but make up with an amazing trade value.\",\"\",\" Collect your  way to riches!\"]',NULL,0),(53,2,2,1,1,0,'Windows',63,0,'default_3x3','[\"ctlg_windows_headline1_en\",\"ctlg_windows_teaser1_en\",\"catalog_special_txtbg2\"]','[\"Let some sunshine in! Our windows come in many styles to give a unique look to your room. Who said your room can\'t have a view?\",\"Click on the item you want for more information\",\"Ooh, new view!\"]',NULL,0),(54,-1,4,1,0,0,'Pets Shop',8,7,'','[]','[]',NULL,0),(55,54,3,1,1,0,'Pets Info',42,0,'pets2','[\"catalog_pet_headline1\",\"ctlg_pet_note\"]','[\"Pets are inhabitants of Habbo Hotel too, so each pet owner needs to know a bit about them. Look after your pet by looking through our key points below.\",\"A few things you should know:\",\"- You can only put it down in one of your rooms.\\r\\n- There can be 3 pets in each room.\\r\\n- The basket is your pet\'s home. If you pick it up, the pet will go back in your hand.\\r\\n- Every time you visit this page, you will go back to a different selection of pets.\\r\\n- Your pet will sleep more when it gets old\\r\\n- You cannot trade your pet\"]',NULL,0),(56,-1,6,1,0,0,'Pixel Shop',5,5,'','[]','[]',NULL,0),(57,56,4,1,1,0,'Hello Furni',35,0,'pixelrent','[\"catalog_hello_header1_en\",\"catalog_hello_teaser1_en\"]','[\"Hello Furni is available with Pixels and is perfect if you are decorating your room for the very first time. The Furni is yours to keep and therefore cannot be traded.\",\"Click on the item you want for more information\",\" \"]',NULL,0),(58,-1,9,1,0,0,'Ecotron',7,3,'','[]','[]',NULL,0),(59,2,27,1,1,0,'Country',21,0,'default_3x3','[\"catalog_country_header1_en\",\"catalog_country_teaser1_en\",\"catalog_special_txtbg2\"]','[\"Let\'s leave the busy city streets and head over to the wide abyss of golden wheat, emerald fields and home grown, organic vegetables. Everything you need to create a farm!\",\"Click on the item you want for more information\",\"Who\'d be a crow, eh?\"]',NULL,0),(60,56,2,1,1,0,'Special Effects',61,0,'pixeleffects','[\"catalog_pixeleffects_headline1_en\",\"catalog_pxl_teaser1_en\"]','[\"Tune your character with cool effects that fit the occasion. Do you want to fly away with the red carpet or be in the spotlight? Now is your chance!\\r\\n\\r\\nThe effects can be activated in your badge dialog under effects tab.\",\"\",\" \"]',NULL,0),(61,56,3,1,1,0,'Automobile',16,0,'cars','[\"catalog_automobile_header1_en\",\"catalog_automobile_teaser1_en\"]','[\"Every Habbo needs a car effect! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful traffic sign or elegant pile of tires...\",\"Click on the item you want for more information.\",\" \"]',NULL,0),(62,-1,11,6,0,0,'Admin Shop',1,6,'','[]','[]',NULL,0),(63,-1,8,1,1,0,'Habbo Club',9,7,'club1','[\"catalog_club_headline1\",\"clubcat_pic\"]','[\"Welcome to Habbo Club - the members only club that all the best Habbos belong to!\",\"Every member of Habbo Club gets priority access to the hotel. So, if the hotel\'s full up, you\'ll get to the front of the queue automatically - no waiting around! And you\'ll get exclusive clothes, hair colours, furni, special guest room layouts and more besides. Normal Habbos will not have any of these.\",\"How do I join? Use the Navigator to go to \'Hotel View\' and click on the Habbo Club icon. Habbo Club costs 20 Credits a month. We\'ll remind you when your membership is about to run out.\",\"Well, what are you waiting for? Join Habbo Club today!\"]',NULL,0),(64,63,2,1,1,1,'Club Shop',9,0,'default_3x3','[\"catalog_club_headline1\",\"catalog_hc_teaser\",\"catalog_special_txtbg1\"]','[\"NEW Habbo Club Furni range. Allow these elegant delights to make your room sophisticated and humble. They look great placed with your monthly gifts!\",\"Click on the item you want for more information\",\"For Habbo Club members only!\"]',NULL,0),(65,63,1,1,1,0,'Club Info',42,0,'club2','[\"catalog_club_headline1\",\"club_pos\",\"\",\"club_neg\"]','[\"What happens when my Habbo Club runs out?\",\"If your Habbo Club runs out, you WILL be able to keep any rooms you made with a Club layout and the Habbo Club Furni is yours to keep.\",\"If your Habbo Club runs out you WON\'T be able to wander around with a cool HC badge, the funky clothes and your hair will vanish from your Habbo, you won\'t be able to do chose HC rooms layouts in the Room-O-Matics, you\'ll receive no new HC Furni and worst all, you won\'t be able to jump the queue if the Hotel\'s Full!\",\"Stay in Habbo Club for more than a year and you\'ll get a special sparkly BADGE!\"]',NULL,0),(66,2,28,1,1,0,'Glass',29,0,'default_3x3','[\"catalog_glass_headline1\",\"catalog_glass_teaser1\"]','[\"You can really open up a space with this stylish glass furniture, just don\'t walk into it!\",\"Click on the item you want for more information\",\"\"]',NULL,0),(67,2,29,1,1,0,'Greek',31,0,'default_3x3','[\"catalog_greek_header1\",\"catalog_greek_teaser1\"]','[\"Be transported back to ancient Greece with a couple of thousand pounds and British Airways. Until then, build your own panthenon with our realist Greek range!\",\"Click on the item you want for more information\",\"\"]',NULL,0),(68,2,30,1,1,0,'Romantique',50,0,'default_3x3','[\"catalog_romantique_headline1\",\"catalog_romantique_teaser1\"]','[\"The Romantique range features Grand Pianos, old antique lamps and tables. It is the ideal range for setting a warm and loving mood in your room. Spruce up your room and invite that special someone over. Now featuring the extra special COLOUR edition.\",\"Click on the item you want for more information\",\"\"]','12-01',2592000),(69,2,31,1,1,0,'Arctic',13,0,'soundmachine','[\"catalog_arc_header1_en\",\"catalog_arc_teaser1_en\"]','[\"Stay cool (or warm with our campfire!) and create your own Winter Wonderland or Humble Homeland for your penguins.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(70,2,32,1,1,0,'Bensalem',18,0,'default_3x3','[\"catalog_header_bensalem\",\"catalog_teaser_bensalem\"]','[\"The Lost City of Bensalem has been located beneath the sea. We have worked hard to salvage all kinds of fantastic furni, which is now all available below.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(71,2,33,1,1,0,'Neon',41,0,'default_3x3','[\"catalog_neon_header1_en\",\"catalog_neon_teaser1_en\"]','[\"New years eve, birthdays and every other day of the year, there\'s always an excuse for a party! So, why don\'t you buy some Neon furni!?\",\"Click on the item you want for more information\",\"\"]',NULL,0),(72,2,34,1,1,0,'Lost Tribe',38,0,'default_3x3','[\"catalog_header_lost_tribe\",\"LT_teaser_en\"]','[\"Start your own tribal village with our ancient furniture, all carved from hard wearing stone. NOTE: Lava is hot, get an adult to help you.\",\"Click on the item you want for more information\",\"\"]',NULL,0),(73,2,35,1,1,0,'Virus',42,0,'default_3x3','[\"catalog_vir_header1_en\",\"catalog_vir_teaser_en\",\"catalog_special_txtbg1\"]','[\"A virus is spreading through Habbo Hotel. Many casualties reported and it could get much worse! Whether you are hoping to help infected Habbos or look after number one, get your clean hands on our terrifying Infection Furni.\",\"Click on the item you want for more information\",\"Latest virus news on TV now!\"]',NULL,0),(74,58,9,1,1,0,'Ecotron',26,0,'recycler','[\"catalog_recycler_headline3_en\"]','[\"Become an Eco-warrior\\\\r\\\\nRecycle your worthless stuff and be rewarded with a random prize. Check out the prizes and the instructions for recycling.\\\\r\\\\nDrag 5 items to the boxes below and click recycle!\"]',NULL,0),(75,58,9,1,1,0,'Rewards',26,0,'recycler_prizes','[\"catalog_recycler_headline3_en\",\"\",\"\"]','[\"What are the prizes? Ecotron box may contain one of these:\",\"\",\"What are the prizes? Ecotron box may contain one of these:\"]',NULL,0),(76,58,11,6,1,0,'Ecotron Shop',3009,0,'default_3x3','[\"catalog_recycler_headline4_en\",\"\"]','[\"Yet another Ecotron page!\",\"\",\"\"]',NULL,0),(77,58,10,1,1,0,'Instructions',26,0,'pets2','[\"catalog_recycler_headline5_en\",\"ctlg_ecotron_box2\"]','[\"The Ecotron is a furni recycler. Get rid of old furni... what will you get in return? It\'s a surprise! Become a Habbo eco-warrior. No refunds!\",\"How to use the Ecotron?\",\"1. Just drag 5 items from your hand to the Ecotron. One item / square. Recyclable items are marked in your inventory with an image. When you have 5 items in the boxes, click the \\\"Recycle\\\" button. You can now find the Ecotron prize box from your hand.\\r\\n\\r\\n2. Click the box to see its tag. Open the box, or trade it unopened. The timer shows you how long you have to wait before you can recycle more items. Check the prizes before you recycle- don\'t be surprised by the surprise!\"]',NULL,0),(78,2,36,1,1,0,'Kitchen',217,0,'default_3x3',