INSERT INTO `cms_stickers` VALUES (1,1,'570','1078','42',11000,2,2,'',1,''),(2,1,'109','795','10',13,9,2,'[color=white][b]Owl[/b] The old and wise one - loyal owl  with a heart of gold. Level 10[/color]',1,''),(3,1,'189','1069','12',13,2,2,'Well of course I can. Because I am a Habbo Guide!',1,''),(4,1,'109','197','2',13,9,2,'[color=white][b]Bunny[/b] The fast one - catch one if  you can. Level 1[/color]',1,''),(5,1,'109','331','1',13,9,2,'[color=white][b]Otter[/b] The one who does not let  you sink. Level 3[/color]',1,''),(6,1,'110','728','9',13,9,2,'[color=white][b]Eagle[/b] The sharp eyed one - flying to  your aid. Level 9[/color]',1,''),(7,1,'109','528','6',13,9,2,'[color=white][b]Lynx[/b] The hunter one - stalks down  answers. Level 6[/color]',1,''),(8,1,'108','396','3',13,9,2,'[color=white][b]Badger[/b] The digger one - has information  you cannot find. Level 4[/color]',1,''),(9,1,'383','488','32',13,9,2,'[color=white][b]Who are Habbo guides?[/b]  Habbo Guides are experienced players  who like to share their knowledge of  Habbo and welcome new players.  Habbo Guides meet and greet new  Habbos, guide them around and generally making them feel at home.  [b]I\'m new. How do I find a Guide?[/b]  The first time you enter your room in the hotel you will be asked if you would like to meet a Habbo Guide. You can also  identify Guides by their animal badge.   [b]What\'s in it for me?[/b]  A warm fuzzy feeling at the end of the  day, and hopefully the start of many new  friendships :)  [b]Can I join?[/b]  Yes, just join this Group. Anyone who\'s interested in being nice to newcomers is welcome to join - the more the merrier![/color]',1,''),(10,1,'107','864','33',13,9,2,'[color=white][b]Wolf[/b] The eXperienced one with  the knowledge to show the way.  Level X[/color]',1,''),(11,1,'109','667','8',13,9,2,'[color=white][b]Bear[/b] The friendly one  - kind and soft. Level 8[/color]',1,''),(12,1,'639','489','31',13,9,2,'[color=white][b]How do we find the new people?[/b]  When new people join Habbo we\'ll ask  them if they\'d like to meet a Guide  from Habbo. If they say yes, we\'ll send alerts to members of this group  who are in the Hotel at the same time.  Accept the invitation and you\'ll be  whisked off to meet the new person.  You can guide them around Habbo and  show them what it\'s about.  [b]Can I get as many invites as I want?[/b]  Sure, with the Guide tool, You can  decide when You want to receive the  invites. After helping someone, you can  pick up the next invite. The Guide tool is  shown on your screen (in the hotel), in the top left corner.  [b]What do I get for guiding?[/b]  Habbo Guides receive badges to  reward their good work. There are 10  levels to achieve. If you successfully  guide a Habbo, who stays in Habbo as a  player, is your friend and has spent  enough time online, you will be rewarded.  The more Habbos you help, the  cooler the badge! These badges are not  available anywhere else.[/color]',1,''),(13,1,'109','461','5',13,9,2,'[color=white][b]Fox[/b] The clever one - is swift of  thought and foot. Level 5[/color]',1,''),(14,1,'108','264','4',13,9,2,'[color=white][b]Bambi[/b] The cutest one - makes you  wanna hug. Level 2[/color]',1,''),(15,1,'110','596','7',13,9,2,'[color=white][b]Buffalo[/b] The strong one - the one you  can depend on. Level 7[/color]',1,''),(16,1,'25','1164','11',13,2,2,'Hey, I\'m confused. Can you help me?',1,''),(17,1,'515','412','23',2198,0,2,'',1,''),(18,1,'180','122','17',2206,0,2,'',1,''),(19,1,'630','411','25',2206,0,2,'',1,''),(20,1,'137','122','16',2201,0,2,'',1,''),(21,1,'560','412','24',2214,0,2,'',1,''),(22,1,'786','411','29',2203,0,2,'',1,''),(23,1,'830','411','30',2220,0,2,'',1,''),(24,1,'674','411','26',2222,0,2,'',1,''),(25,1,'471','412','22',2198,0,2,'',1,''),(26,1,'426','412','21',2193,0,2,'',1,''),(27,1,'263','121','19',2220,0,2,'',1,''),(28,1,'720','411','27',2208,0,2,'',1,''),(29,1,'94','122','15',2193,0,2,'',1,''),(30,1,'222','122','18',2203,0,2,'',1,''),(31,1,'50','121','14',2198,0,2,'',1,''),(32,1,'741','411','28',2201,0,2,'',1,''),(33,1,'381','413','20',2207,0,2,'',1,''),(34,1,'26','11','105',11100,5,1,'',1,''),(35,1,'472','10','101',11000,5,1,'',1,''),(36,1,'39','325','16',13,2,1,'[b]How do I get around?[/b]  Use the Hotel Navigator to get from room to room. The button is at the bottom of your screen and looks like an orange hotel tower. Youll be able to visit public rooms, guest rooms. You can also start building your own room by clicking on Create Own Room under My Rooms.',1,''),(37,1,'291','556','113',13,2,1,'[b]What if I see someone breaking the rules?[/b]  If you need help from a moderator, you can:  -Use the Call For Help Emergency System. Its the blue question mark on the bottom right side of your screen.   -May join our Discord ([i]The widget can be found on the /me page[/i]) and tell us what happened.  -May visit our Help Desk: [b]Room Name:[/b] ClassicHabbo Help Desk [b]Room Owner:[/b] Toya',1,''),(38,1,'487','357','111',13,2,1,'[b]Habbo Lingo  just a few words you might need to know:[/b]  [b]Furni[/b]  Furniture [b]Bobba[/b]  When a word is filtered, it comes up as Bobba [b]Hand[/b]  Where all your furni ends up when you buy it. [b]Console[/b]  The Habbo Messenger [b]Nav[/b]  The Hotel Navigator [b]Norm[/b]  A non-HC member. [b]HC[/b]  Habbo Club',1,''),(39,1,'107','835','94',13,2,1,'[b]Room Games[/b]  [b]DYP, Defend Your Pod[/b] - A popular room game in Habbo, where each Habbo must defend their own pod while trying to sit in another Habbos pod for a brief time to get them out.  [b]FF, Falling Furni[/b] - A game where the owner drops furniture, and the Habbos playing have to race to it. ',1,''),(40,1,'107','989','95',13,2,1,'[b]Dhtw, Dont Hit The Wall[/b] - A dice is rolled and if it is your number, you move up. First one to the wall losses.  [b]CC, Cozzie Change[/b] - A costume change game, where the host announces a theme and you change your clothes to match the theme.',1,''),(41,1,'563','570','148',13,2,1,'[b]Staff Members:[/b]  [b]Alex[/b] - Administrator & Developer [b]Copyright[/b] - Community Manager [b]Chris[/b] - Community Manager [b]Siract[/b] - Community Manager  [b]Representatives:[/b]  Joee Elijah UnityX Ultra',1,''),(42,1,'628','741','23',11000,3,4,'',1,''),(43,1,'667','611','35',13,0,4,'[b]Tip 5:[/b] Bouncing on your tile three times locks the square- make shapes out of locked tiles to lock all the tiles within.',1,''),(44,1,'85','383','94',13,0,4,'[b][color=#ffce00]Power Drill: [/color][/b][color=#fe6301]Bounce on any tile in  the field to clear it. [/color]',1,''),(45,1,'369','317','20',13,4,4,'[b]Free Battleball[/b]  Yes until further notice we\'re letting you play both SnowStorm and Battleball for free - no tickets required.  [b]Please note:[/b] * skill levels don\'t apply for the free games - everyone can play everyone',1,''),(46,1,'86','318','100',13,0,4,'[b][color=#ffce00]Battle Bomb: [/color][/b][color=#fe6301]Clears all tiles  around it- even yours![/color]',1,''),(47,1,'30','30','16',13,2,4,'[b]Want to know how to play?  Read the instructions in our [url=https://habbolegacy.com/groups/1/id/discussions]discussion forum[/url][/b]',1,''),(48,1,'84','452','83',13,0,4,'[b][color=#ffce00]Light Bulb: [/color][/b][color=#fe6301]Turns all the tiles in a  small area your colour.[/color]',1,''),(49,1,'84','584','96',13,0,4,'[b][color=#ffce00]Flashlight: [/color][/b][color=#fe6301]Colours all the tiles in a  straight line in front of you[/color]',1,''),(50,1,'85','255','89',13,0,4,'[b][color=#ffce00]Box of pins: [/color][/b][color=#fe6301]Bouncing on these will burst your ball![/color]',1,''),(51,1,'697','414','43',13,0,4,'[b]Tip 3:[/b] Distract your opponent by calling him or her strange names like &quot;llama feet&quot;.',1,''),(52,1,'682','309','49',13,0,4,'[b]Tip 2:[/b] Bounce on your own squares multiple times to gain extra points, rather than on empty squares.',1,''),(53,1,'84','714','104',13,0,4,'[b][color=#ffce00]Random: [/color][/b][color=#fe6301]Gives you a power-up chosen at random![/color]',1,''),(54,1,'683','254','47',13,0,4,'[b]Tip 1:[/b] Bouncing over your opponents squares earns you more points than bouncing on empty squares.',1,''),(55,1,'84','650','102',13,0,4,'[b][color=#ffce00]Harlequin: [/color][/b][color=#fe6301]Makes all other players colour tiles for your team.[/color]',1,''),(56,1,'683','222','108',13,0,4,'[size=large][b]Tips & Tactics[/b][/size]',1,''),(57,1,'669','532','31',13,0,4,'[b]Tip 4:[/b] The best power-up is the  Harlequin, while the worse is the box of pins which can harm you most of all!',1,''),(58,1,'85','519','98',13,0,4,'[b][color=#ffce00]Spring: [/color][/b][color=#fe6301]Locks tiles to your colour with a single bounce.[/color]',1,''),(59,1,'256','391','2',1129,0,4,'',1,''),(60,1,'627','370','39',1129,0,4,'',1,''),(61,1,'799','211','1',212,0,4,'',1,''),(62,1,'476','492','34',11000,2,5,'',1,''),(63,1,'56','333','8',46,0,5,'',1,''),(64,1,'210','1257','22',141,0,5,'',1,''),(65,1,'153','337','10',49,0,5,'',1,''),(66,1,'462','344','12',1308,0,5,'',1,''),(67,1,'59','414','19',56,0,5,'',1,''),(68,1,'215','321','11',52,0,5,'',1,''),(69,1,'222','410','14',47,0,5,'',1,''),(70,1,'171','439','16',39,0,5,'',1,''),(71,1,'273','416','13',45,0,5,'',1,''),(72,1,'141','238','7',54,0,5,'',1,''),(73,1,'271','470','15',1226,0,5,'',1,''),(74,1,'189','256','4',57,0,5,'',1,''),(75,1,'672','228','3',1914,0,5,'',1,''),(76,1,'146','410','17',45,0,5,'',1,''),(77,1,'238','243','5',50,0,5,'',1,''),(78,1,'94','321','9',57,0,5,'',1,''),(79,1,'222','1267','6',1309,0,5,'',1,''),(80,1,'101','436','18',54,0,5,'',1,''),(81,1,'425','1223','25',170,0,5,'',1,''),(82,1,'618','44','58',11000,4,6,'',1,''),(83,1,'63','613','55',13,0,6,'Space',1,''),(84,1,'85','713','23',13,0,6,'[b]Tips &amp; Tactics[/b]',1,''),(85,1,'40','542','53',13,0,6,'Moving',1,''),(86,1,'54','958','33',13,0,6,'[color=#d80000][b]Tip 2:[/b][/color] If you are wobbling all over  the place, you can get your  balance back once during  the game using the \'stabilise\' button  (space bar).',1,''),(87,1,'90','742','31',13,9,6,'[color=#d80000][b]Tip 1:[/b][/color] When the game starts, you will see a pop up window. On the right is a balance meter.   When the hand points straight up, you\'re perfectly balanced. When it  points to the right, you need to  balance to the left, and vice versa.   If the hand drops too far either side you have lost your balance and will fall into the water and lose.',1,''),(88,1,'56','1034','29',13,0,6,'[color=#d80000][b]Tip 3:[/b][/color] Moving away from your  opponent during a game  will allow you time to balance.',1,''),(89,1,'334','955','14',13,4,6,'[color=#d80000][b]The Queue System[/b][/color]  When you have a ticket, get into the pool, swim over and climb on the inflatables to queue for your turn.   The game starts when two players are ready.',1,''),(90,1,'178','468','35',13,0,6,'Balance',1,''),(91,1,'43','488','51',13,0,6,'Push',1,''),(92,1,'336','745','25',13,4,6,'[color=#d80000][b]Buying Tickets[/b][/color]  To play Wobble Squabble, you need tickets. You can get tickets by clicking on the inflatables, or by clicking on the ticket machine beside the pool.  Tickets cost [b][color=#fe6301]6 Credits for 20[/color][/b] or [b][color=#fe6301]1 Credit for 2[/color][/b].   In Wobble Squabble the winner stays on, so if you win a game stay on the inflatables and the next one is free!',1,''),(93,1,'28','438','47',13,0,6,'Balance',1,''),(94,1,'760','248','3',1129,0,6,'',1,''),(95,1,'330','207','1',150,0,6,'',1,''),(96,1,'329','145','2',150,0,6,'',1,''),(97,1,'162','387','2',13,2,3,'[b]Eeek, collision course![/b]',1,''),(98,1,'644','11','19',11000,5,3,'',1,''),(99,1,'69','194','6',13,2,3,'[b]Hey dude! Don\'t you know the rules? Check out the How to Play thread in the [url=https://habbolegacy.com/groups/snowstorm/discussions]discussion forum[/url][/b]',1,''),(100,1,'516','1083','1',13,2,3,'[b]Not again...[/b]',1,''),(101,1,'556','317','4',183,0,3,'',1,'');
